import React, { Component } from 'react';

class TOC extends Component {
    render() {
      let data = this.props.data;
      const lists = [];
      for (let item of data) {
          lists.push(<li><a href={"/constent" + item.id}>{item.title}</a></li>)
      }
      return (
        <nav>
            <ul>
                {lists}
            </ul>
        </nav>
      )
    }
}

export default TOC;
